import "react-alice-carousel/lib/alice-carousel.css";

class basket extends Component {
    constructor() {
        super();
        this.state = {
            products: [],

        };
    }
 
    render() {
        return (

            <Container style={{ width: "auto", textAlign: "-webkit-center" }}>
                <div className="card" style={{ width: "auto", marginRight: "1vh", marginLeft: "1vh", maxWidth: "initial" }}>
                    <h1 className="mt-5">Basket</h1>
                    <Row style={{ margin: "5vh", justifyContent: "space-around" }}><CardColumns>Basket</CardColumns></Row>
                </div>
            </Container>


        );
    }

}
export default basket;
